import styled from 'styled-components'
import Grid from '@mui/material/Grid'

export const SidebarWrapper = styled(Grid)`
    background-color: #11316c;
    height: 100vh;
    color: #fff;
    min-height: 100%;
    ul{
        padding: 30px 0;
        margin: 0;
        li{
            list-style: none;
            &.menu{
                padding: 10px 15px;
                border-bottom: 1px solid #fff;
            }
        }
    }
`
